import "./explorePage.css";
 import Navbar from "../../components/navbar/Navbar";
 import Explore from "../../components/explore/Explore";


const ExplorePage = () => {
  return (
    <div className='pagecontainer'>
      <Navbar />
      <Explore/>
    </div>
  )
}

export default ExplorePage;
